__NUXT_JSONP__("/drugs/Alanosine", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"5854-93-3",chebiId:"",chemicalFormula:"C3H7N3O4",definition:"An amino acid analogue and antibiotic derived from the bacterium Streptomyces alanosinicus with antimetabolite and potential antineoplastic activities. L-alanosine inhibits adenylosuccinate synthetase, which converts inosine monophospate (IMP) into adenylosuccinate, an intermediate in purine metabolism. L-alanosine-induced disruption of de novo purine biosynthesis is potentiated by methylthioadenosine phosphorylase (MTAP) deficiency. The clinical use of this agent may be limited by its toxicity profile. MTAP is a key enzyme in the adenine and methionine salvage pathways.",fdaUniiCode:"2CNI71214Y",identifier:"C994",preferredName:a,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C1556","C2168"],synonyms:["3-(Hydroxynitrosoamino)-L-alanine","ALANOSINE",a,"L-2-Amino-3-(hydroxynitrosoamino)propionic Acid","L-2-Amino-3-[(N-nitroso)hydroxylamino]propionic Acid","L-2-Amino-3-[(N-nitroso)hydroxylamino]propionic acid","L-Alanosine","L-Alanosine Sodium","SDX-102","alanosine"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAlanosine",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Alanosine","2021-10-30T13:49:03.773Z")));